import styled from "styled-components";
import diceImageone from "../images/image1.png"; 
const RollDice=()=>{
    return(
    <DiceContainer>
        <div>
        <img src={diceImageone} alt="dice image" />
            </div>
            </DiceContainer> 
    );
};
export default RollDice;
const DiceContainer=styled.div``;
